public class InnerDashboardDefaultNewSheetConfigurationFactory(Action<Humidifier.QuickSight.DashboardTypes.DefaultNewSheetConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.QuickSight.DashboardTypes.DefaultNewSheetConfiguration>
{

    internal InnerDashboardDefaultInteractiveLayoutConfigurationFactory InteractiveLayoutConfigurationFactory { get; set; }

    internal InnerDashboardDefaultPaginatedLayoutConfigurationFactory PaginatedLayoutConfigurationFactory { get; set; }

    protected override Humidifier.QuickSight.DashboardTypes.DefaultNewSheetConfiguration Create()
    {
        var defaultNewSheetConfigurationResult = CreateDefaultNewSheetConfiguration();
        factoryAction?.Invoke(defaultNewSheetConfigurationResult);

        return defaultNewSheetConfigurationResult;
    }

    private Humidifier.QuickSight.DashboardTypes.DefaultNewSheetConfiguration CreateDefaultNewSheetConfiguration()
    {
        var defaultNewSheetConfigurationResult = new Humidifier.QuickSight.DashboardTypes.DefaultNewSheetConfiguration();

        return defaultNewSheetConfigurationResult;
    }
    public override void CreateChildren(Humidifier.QuickSight.DashboardTypes.DefaultNewSheetConfiguration result)
    {
        base.CreateChildren(result);

        result.InteractiveLayoutConfiguration ??= InteractiveLayoutConfigurationFactory?.Build();
        result.PaginatedLayoutConfiguration ??= PaginatedLayoutConfigurationFactory?.Build();
    }

} // End Of Class

